    @Test
    public void test0Day() {
        LocalDate now = LocalDate.now();
        LocalDate now1 = LocalDate.now();
        long between = ChronoUnit.DAYS.between(now, now1);
        System.out.println(between);
        System.out.println(between * 3.3);
        System.out.println(now.isEqual(now1));
    }

    @Test
    public void testEncode() throws Exception{
        String unicode = URLEncoder.encode("test,unicode", "unicode");
        System.out.println(unicode);
        String utf8 = URLEncoder.encode("test.utf-8", "utf-8");
        System.out.println(utf8);
        String encode = URLEncoder.encode(",", "utf-8");
        String decode = URLDecoder.decode(encode, "unicode");
        System.out.println(decode);
    }

